import React from 'react';

// ✅ Correct image imports (go up one level to access `src/assets/img/staff/`)
import maria from '../assets/img/staff/maria.jpg';
import ella from '../assets/img/staff/ella.jpg';
import suleyman from '../assets/img/staff/suleyman.jpg';
import cumali from '../assets/img/staff/cumali.jpg';
import isa from '../assets/img/staff/isa.jpg';
import gokhan from '../assets/img/staff/gokhan.jpg';
import furkan from '../assets/img/staff/furkan.jpg';
import rojhat from '../assets/img/staff/rojhat.jpg';
import mert from '../assets/img/staff/mert.jpg';
import john from '../assets/img/staff/john.jpg';
import yusuf from '../assets/img/staff/yusuf.jpg';

// Staff Data
const staffMembers = [
    { name: "Maria Voicova", role: "Director", photo: maria },
    { name: "Ella Bagci", role: "Music Teacher", photo: ella },
    { name: "David Davidson", role: "Art Instructor", photo: suleyman },
    { name: "Cumali Akbas", role: "Skill Director", photo: cumali },
    { name: "Isa Kurucan", role: "Skill Director", photo: isa },
    { name: "Gokhan Bagci", role: "Chef", photo: gokhan },
    { name: "Furkan Bagci", role: "Chef", photo: furkan },
    { name: "Rojhat Bagci", role: "Facilities Management", photo: rojhat },
    { name: "Mert Bagci", role: "Coding Instructor", photo: mert },
    { name: "John Bagci", role: "Coding Instructor", photo: john },
    { name: "Yusuf Bagci", role: "Director Assistant", photo: yusuf },
];

const StaffPage = () => {
    return (
        <div style={{ textAlign: "center", margin: "20px" }}>
            <h1 style={{ color: "#4caf50" }}>Meet Our Team</h1>
            <p style={{ fontSize: "1.2rem", color: "#555", maxWidth: "800px", margin: "auto" }}>
                Our dedicated team of professionals is here to support your child’s development.
            </p>

            {/* Staff Grid */}
            <div className="staff-grid">
                {staffMembers.map((staff, index) => (
                    <div key={index} className="staff-card">
                        <img src={staff.photo} alt={staff.name} className="staff-photo" />
                        <h3>{staff.name}</h3>
                        <p>{staff.role}</p>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default StaffPage;
